import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Switch } from 'react-router-dom';
import SignInAndSignUpPage from './pages/signin-signup/signin-singup.page';


function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path='/' exact component={SignInAndSignUpPage} />
      </Switch>
    </BrowserRouter>
    
  );
}

export default App;
